caption:
(
A
) Tumor cells are spindly, arranged in sheets, pattern less pattern, and vague storiform pattern (Hematoxylin and Eosin stain [H&E stain], original magnification 100X). (
B
) Cellular area with cells having spindly to plump nuclei with granular to vesicular chromatin and inconspicuous nucleoli (H&E stain, original magnification 400X).

Tumor cells diffusely express (
A
) CD34, (
B
) Bcl2, and (
C
) STAT6 (immunohistochemistry, 3,3′-diaminobenzidine chromogen, original magnification 100X).

Axial (
a
), coronal (
b
), and sagittal (
c
) T2-weighted images centered on the cerebellopontine angle demonstrate a homogeneous extra-axial mass with internal vascularity with mass effect on the pons, middle cerebellar peduncle, and cerebellum. The mass occupies the expected location of cranial nerves V,VI,VII,VIII. (
d
). Balanced Fast Field Echo (FFE) sequence (a sequence that allows detailed visualization of the cranial nerves in the posterior fossa) demonstrates expected locations of CN VI in Dorello's canal (
white arrow
) and CN VII and CN VIII (
black arrow
). There is a large mass within the right cerebellopontine angle extending into the right internal auditory canal and occupying the prepontine cistern along the expected course of the right CN VI. Visualization of the right-sided cranial nerves is obscured by the mass. There is mass effect on the pons and middle cerebellar peduncle with partial effacement of the fourth ventricle. (
e
) Coronal T2-weighted image at the level of the internal acoustic meatus demonstrates normal left-sided CN V (
white arrow
) and CN VII and CN VIII (
black arrow
). These spaces are occupied by the mass on the right and obscure visualization of the cranial nerves.

(
a
) Hematoxylin and eosin (H&E) (×20) shows a uniform, small, bland tumor cells some with plasmacytoid appearance. (
b
) H&E (×40), nuclear molding with sparse areas of background necrosis, fine granular chromatin with inconspicuous nucleoli and few mitotic figures, few apoptotic bodies and vascular infiltration. (
c
) CD56 strong diffusely positive. (
d
) Synaptophysin strong diffusely positive. (
e
) Chromogranin A strong diffusely positive. (f) Ki67 8%, which categorizes a grade 2 (3–20% Ki67 index).

(
a
) Nuclear Medicine (NM) gallium 68 PET/CT scan showing site of greater uptake in the left lower lobe (
bottom right arrow
) of the thyroid gland that corresponds to a low-density site on the CT (
b
) (
bottom right arrow
).
